const items = [
    {
      id: Math.random(),
      title: "Lunch",
      description: "text",
      price: "price",
      imgUrl: "1.png",
    },
    {
      id: Math.random(),
      title: "Breakfast",
      description: "text2",
      price: "price",
      imgUrl: "2.png",
    },
    {
      id: Math.random(),
      title: "Breakfast",
      description: "text3",
      price: "price",
      imgUrl: "3.png",
    },
    // ...additional items
  ];
